  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144981 includes discrete
  sample and profile data collected from HEALY in the Bering Sea from 2008-07-03 to
  2008-07-31. These data include AMMONIUM (NH4), DISSOLVED INORGANIC CARBON (DIC),
  DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE,
  SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE, phosphate and silicate. The
  instruments used to collect these data include Alkalinity titrator, CTD, Coulometer
  for DIC measurement and bottle.nnThese data were collected by Nicholas Bates of
  Bermuda Biological Station for Research and Jeremy Mathis of US DOC; NOAA; OAR;
  Pacific Marine Environmental Laboratory as part of the CLIVAR_HLY0803 data set.
  CDIAC associated the following cruise ID(s) with this data set: BEST '08 Summer
  and HLY0803nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.nnThe International CLIVAR Global
  Ocean Carbon and Repeat Hydrography Program carries out a systematic and global
  re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes in
  storage and transport of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
